import React from "react";

import "./SkinOptions.css";

const SkinOptions = (props) => {
  const options = [
    {
      text: "Oleosa",
      handler: () => {},
      id: 1,
    },
    {
      text: "Seca",
      handler: () => {},
      id: 2,
    },
  ];

  const optionsMarkup = options.map((option) => (
    <button
      className="skin-option-button"
      key={option.id}
      onClick={option.handler}
    >
      {option.text}
    </button>
  ));

  return (
    <div className="skin-options-container">
      {optionsMarkup}
    </div>
  );
};

export default SkinOptions;
